<script src="https://google-code-prettify.googlecode.com/svn/loader/run_prettify.js"></script>
<script src="https://google-code-prettify.googlecode.com/svn/trunk/src/prettify.js"></script>

<script type="text/javascript" src="https://cdnjs.cloudflare.com/ajax/libs/toastr.js/latest/js/toastr.js"></script>

<script>
    $(document).ready(function () {

        $("#form-get-name-day").submit(function (e) {
            e.preventDefault();
            submitForm($(this), function (data) {
                var resultEl = $("#form-get-name-day-result");
                resultEl.removeClass("prettyprinted");
                resultEl.text(data);
                prettyPrint();
            });
            return false;
        });

        $("#form-get-date-by-country-and-name").submit(function (e) {
            e.preventDefault();
            submitForm($(this), function (data) {
                var resultEl = $("#form-get-date-by-country-and-name-result");
                resultEl.removeClass("prettyprinted");
                resultEl.text(data);
                prettyPrint();
            });
            return false;
        });

        $("#form-get-holiday-by-country").submit(function (e) {
            e.preventDefault();
            submitForm($(this), function (data) {
                var resultEl = $("#form-get-holiday-by-country-result");
                resultEl.removeClass("prettyprinted");
                resultEl.text(data);
                prettyPrint();
            });
            return false;
        });

        $("#form-get-memory-day-by-country").submit(function (e) {
            e.preventDefault();
            submitForm($(this), function (data) {
                var resultEl = $("#form-get-memory-day-by-country-result");
                resultEl.removeClass("prettyprinted");
                resultEl.text(data);
                prettyPrint();
            });
            return false;
        });

        var action = '';
        $("#form-post-resource").submit(function (e) {
            e.preventDefault();
            if (action == '') {
                action = $(this).attr('action');
            }
            $(this).attr('action', action + $("#resource").val());

            submitForm($(this), function (data) {

                var resultEl = $("#form-post-resource-result");
                resultEl.removeClass("prettyprinted");
                resultEl.text(data);
                prettyPrint();

            });
            return false;
        });


        var submitForm = function (form, callback) {

            var contentType;
            var outputVal = form.find("input[name=output]:checked").val();
            if (outputVal == "json") {
                contentType = "application/json, charset=utf-8";

            }
            if (outputVal == "xml") {
                contentType = "xml, charset=utf-8";
            }

            var attr = {
                url: form.attr('action') + "&" + outputVal,
                data: JSON.stringify(getFormData(form)),
//                dataType: "json",
                type: 'POST',
                contentType: contentType,
                success: function (data) {

                    console.log(data);
                    var response = "";
                    if (outputVal == "json") {
                        response = JSON.stringify(data);
                    }
                    if (outputVal == "xml") {
                        response += formatXml((new XMLSerializer()).serializeToString(data));
//                        response += formatXml($(data).text());
                    }


                    if (typeof callback === "function") {
                        callback(response);
                    }
                },
                error: function (jqXHR, textStatus, errorThrown) {
                    toastr['error'](jqXHR.status + " " + errorThrown);
                    console.log(textStatus, errorThrown);
                }
            };

            $.ajax(attr);

        };


        function getFormData($form) {
            var unindexed_array = $form.serializeArray();
            var indexed_array = {};

            $.map(unindexed_array, function (n, i) {
                indexed_array[n['name']] = n['value'];
            });

            return indexed_array;
        }

        function formatXml(xml) {
            var formatted = '';
            var reg = /(>)(<)(\/*)/g;
            xml = xml.replace(reg, '$1\r\n$2$3');
            var pad = 0;
            jQuery.each(xml.split('\r\n'), function (index, node) {
                var indent = 0;
                if (node.match(/.+<\/\w[^>]*>$/)) {
                    indent = 0;
                } else if (node.match(/^<\/\w/)) {
                    if (pad != 0) {
                        pad -= 1;
                    }
                } else if (node.match(/^<\w[^>]*[^\/]>.*$/)) {
                    indent = 1;
                } else {
                    indent = 0;
                }

                var padding = '';
                for (var i = 0; i < pad; i++) {
                    padding += '  ';
                }

                formatted += padding + node + '\r\n';
                pad += indent;
            });

            return formatted;
        }

    });
</script>

</body>
</html>